import React from 'react';

const Users = () => {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Users</h1>
      <div className="card">
        <div className="card-body">
          <p className="text-sm text-gray-600">User management UI coming soon.</p>
        </div>
      </div>
    </div>
  );
};

export default Users;
